import React, { Component } from 'react';
import RawText from './RawText'
import Main from "./Main";
import Footer from "./Footer";

class App extends Component {
  render() {
    return (
      <div className="App">
    	<Main />
        <Footer />
      </div>
    );
  }
}

export default App;
